import { Container } from "./styles";

const Home = () => {
  return (
    <Container>
      <header>
        <Titulo />
        <figure>
          <img
            src="https://images-na.ssl-images-amazon.com/images/I/71+mDoHG4mL.png"
            alt="user"
          />
        </figure>
      </header>
      <div className="minhasTecnologias">

      </div>
      <div className="MeusTrabalhos">

      </div>
      <div className="dadosUser">

      </div>
    </Container>
  );
};

export default Home;
